    property_Power+=fabs(n_ref_Ids*((vbias_V)-(CONST_0_V)));
    property_Power+=fabs(n_out_Ids*((outp_V)-(CONST_0_V)));
    property_Power+=fabs(p_out_Ids*((outp_V)-(vdd_V)));
    property_Adc=20*log10(fabs(property_Adc));
    property_CMRR=20*log10(fabs(property_CMRR));
    property_CMRR=property_Adc-property_CMRR;
    property_PSRR=20*log10(fabs(property_PSRR));
    property_PSRR=property_Adc-property_PSRR;
    if (max_Adc<property_Adc) max_Adc=property_Adc;
    PAT *p=(PAT *)Pdiffpair_output_nmos_circuits_PAT;
    float sizes[13];
    sizes[0]=size_Lp;
    sizes[1]=size_Wp;
    sizes[2]=size_Ln;
    sizes[3]=size_Wn;
    sizes[4]=size_Ls;
